import React from 'react';


const HomePage = ()=>(
    <>
    <h1>Hello, this is Binoy's blog</h1>
    <p>Never thought I'd make it. Three days grade school, 
        three days high school. Those were awkward. Three 
        days college. I'm glad I took a day and hitchhiked 
        around the hive. You did come back different.</p>
    </>
);

export default HomePage;
